    require(msg.sender == getOwner(), "Caller is not the owner");

    // Validate max transaction amount
    require(maxTxAmount > 0, "Max transaction amount must be greater than zero");
    require(maxTxAmount == (maxTxAmount * denominator) / denominator || denominator == 0, "Invalid max transaction amount");

