    // Validate max wallet token
    require(maxWalletToken > 0, "Max wallet token must be greater than zero");
    require(maxWalletToken == (maxWalletToken * denominator) / denominator || denominator == 0, "Invalid max wallet token");

    // Update state variables
    _maxTxAmount = (maxTxAmount * denominator) / 10000;
    _maxSellAmount = (maxSellAmount * denominator) / 10000;
    _maxWalletToken = (maxWalletToken * denominator) / 10000;
